  from the data that is displayed in the Tool and includes additional information
  about the ownership that is not displayed on the website.The date Modified in the
  zipped file indicates the date of the last refresh of the data. For information
  about Facilities and Vendors in a particular geographical area, you should use the
  Compare tool instead of downloading the data. The followings tools are represented,
